
/* 
This file creates the tables 
and populates them
*/


drop table if exists tblvenue ;
drop table if exists tblstate;
drop table if exists tblcountry;
drop table if exists tblshow;
drop table if exists tblsetlist;
drop table if exists tbljam;
drop table if exists tblsong;
drop table if exists tblsettype;

/* RUN ALL OF THESE FROM THE MYSQL COMMAND LINE */


create table tblSetType
(
SetTypeID int,
SetType char(12)
);


create table tblvenue
(
VenueID int,
Venue varchar(100),
City varchar(100),
StateID int,
CountryID tinyint
);

create table tblstate
(
StateID int,
StateName varchar(50),
StateAbbreviation char(2)
);

create table tblcountry
(
CountryID int,
CountryName varchar(25)
);

 
create table tblshow
(
ShowID int,
ShowDate date,
ShowName varchar(30),
DeadbaseID int,
VenueID int,
TapeRank int,
GotIT int,
Quality int,
MyNotes varchar(255)
);

 
create table tblsetlist
(
SetListID int NOT NULL AUTO_INCREMENT, 
ShowID int,
LineNr int,
SetText varchar(1024),
PRIMARY KEY (SetListID)
);


create table tbljam
(
JamID int,
SetListID int,
JamNr int,
JamText varchar(1024)
);

create table tblsong
(
SongID int,
JamID int,
SongNr decimal(6,2),
SongText varchar(1024),
JammedInto char(1)
);


